export function groupByRegNo(students) {
    return students.reduce((acc, student) => {
        const regNo = student.Reg_No;

        if (!acc[regNo]) {
            // If Reg_No does not exist in the accumulator, create an entry
            acc[regNo] = {
                Name: student.Name,
                Reg_No: student.Reg_No,
                Year: student.Year,
                School: student.School,
                Applications: []
            };
        }

        // Push the application details to the Applications array
        acc[regNo].Applications.push({
            Company: student.Company,
            ApplicationStatus: student.ApplicationStatus,
            Type: student.Type,
            CTC: student.CTC
        });

        return acc;
    }, {});
}
